// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity >=0.8.0 <0.9.0;

import '@openzeppelin/contracts/token/ERC20/ERC20.sol';
import '@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol';
import '@openzeppelin/contracts/access/Ownable.sol';
import '@openzeppelin/contracts/utils/structs/EnumerableSet.sol';
import '../swap/uniswap-v2/interfaces/IUniswapV2Factory.sol';
import '../swap/uniswap-v2/interfaces/IUniswapV2Router02.sol';
import '../swap/uniswap-v2/interfaces/IWETH.sol';

interface ITreasury {
  function setTonic(address) external;
}

// FIXME: Implement
interface IJackpot {
  function tradeEvent(address sender, uint256 amount) external;
}

interface IDogeBonusPool {
  function deposit(uint256 _pid, uint256 _amount) external;

  function withdraw(uint256 _pid, uint256 _amount) external;

  // function emergencyWithdraw(uint256 _pid) external;

  function injectRewards(uint256 amount) external;

  function injectRewardsWithTime(uint256 amount, uint256 rewardsSeconds) external;
}

contract TonicToken is ERC20, ERC20Burnable, Ownable {
  /// @notice Token Distribution
  uint256 public constant TOTAL_SUPPLY = 1_000_000e18;
  uint256 public constant MINING_SUPPLY = 400_000e18;
  uint256 public constant TEAM_SUPPLY = 200_000e18;
  uint256 public constant PROTOCOL_SUPPLY = 350_000e18;
  uint256 public constant AIRDROP_SUPPLY = 50_000e18;
  uint256 public constant STAKING_REWARD_SUPPLY = 50_000e18;

  uint256 public launchedAt;
  uint256 public launchedAtTimestamp;
  bool public initialized;

  IUniswapV2Factory public uniswapV2Factory;
  IUniswapV2Router02 public uniswapV2Router;
  IWETH public WETH;
  address private constant ZERO = 0x0000000000000000000000000000000000000000;

  address public protocolTreasury;
  address public devTreasury;
  address public jackpotTreasury;

  constructor(
    string memory name,
    string memory symbol,
    address _liquidityMiningTreasury, // set and used once
    address _protocolTreasury,
    address _jackpotTreasury,
    address _devTreasury,
    address _uniswapV2Factory,
    address _uniswapV2Router,
    address _weth
  ) ERC20(name, symbol) {
    canAddLiquidityBeforeLaunch[_msgSender()] = true;
    canAddLiquidityBeforeLaunch[address(this)] = true;

    // deployer
    isFeeExempt[msg.sender] = true;

    // token contract
    isFeeExempt[address(this)] = true;

    // underlying exchange
    uniswapV2Factory = IUniswapV2Factory(_uniswapV2Factory);
    uniswapV2Router = IUniswapV2Router02(_uniswapV2Router);
    WETH = IWETH(_weth);

    {
      ITreasury target = ITreasury(_liquidityMiningTreasury);
      target.setTonic(address(this));
    }

    _mint(_liquidityMiningTreasury, MINING_SUPPLY);
    _mint(_protocolTreasury, PROTOCOL_SUPPLY);

    // TODO: finish rest of the distribution

    protocolTreasury = _protocolTreasury;
    devTreasury = _devTreasury;
    jackpotTreasury = _jackpotTreasury;
  }

  event SwapBack(uint256 burn, uint256 gov, uint256 liquidity, uint256 jackpot, uint256 dev, uint timestamp);
  event Trade(
    address user,
    address pair,
    uint256 amount,
    uint side,
    uint256 circulatingSupply,
    uint timestamp
  );
  event AddLiquidity(uint256 tokenAmount, uint256 ethAmount, uint256 timestamp);

  bool public swapEnabled = true;
  bool public addLiquidityEnabled = true;

  bool public inSwap;
  modifier swapping() {
    inSwap = true;
    _;
    inSwap = false;
  }

  mapping(address => bool) public isFeeExempt;
  mapping(address => bool) public canAddLiquidityBeforeLaunch;

  // total tax = 8% (burn = 1%, gov = 1%, liquidity = 2%, jackpot = 3%, dev = 1%)
  uint256 private burnFee = 100;
  uint256 public govFee = 100;
  uint256 private liquidityFee = 200;
  uint256 private jackpotFee = 300;
  uint256 private devFee = 100;

  // uint256 private totalFee = burnFee + govFee + liquidityFee + jackpotFee + devFee;
  uint256 public feeDenominator = 10000;

  using EnumerableSet for EnumerableSet.AddressSet;
  EnumerableSet.AddressSet private _pairs;

  function totalFee() public view returns (uint256) {
    return burnFee + govFee + liquidityFee + jackpotFee + devFee;
  }

  function initializePair() external onlyOwner {
    require(!initialized, 'Already initialized');
    address pair = uniswapV2Factory.createPair(address(WETH), address(this));
    _pairs.add(pair);
    initialized = true;
  }

  function transfer(address to, uint256 amount) public virtual override returns (bool) {
    return _tonicTransfer(_msgSender(), to, amount);
  }

  function transferFrom(
    address sender,
    address recipient,
    uint256 amount
  ) public virtual override returns (bool) {
    address spender = _msgSender();
    _spendAllowance(sender, spender, amount);
    return _tonicTransfer(sender, recipient, amount);
  }

  function _tonicTransfer(address sender, address recipient, uint256 amount) internal returns (bool) {
    if (inSwap) {
      _transfer(sender, recipient, amount);
      return true;
    }

    bool shouldTakeFee = (!isFeeExempt[sender] && !isFeeExempt[recipient]);
    uint side = 0;
    address user_ = sender;
    address pair_ = recipient;
    // Set Fees
    if (isPair(sender)) {
      side = 1;
      user_ = recipient;
      pair_ = sender;

      // TODO: jackpot here
      // try jackpotWallet.tradeEvent(sender, amount) {} catch {}
    } else if (isPair(recipient)) {
      side = 2;
    } else {
      shouldTakeFee = false;
    }

    if (shouldSwapBack()) {
      swapBack();
    }

    uint256 amountReceived = shouldTakeFee ? takeFee(sender, amount) : amount;
    _transfer(sender, recipient, amountReceived);

    if (side > 0) {
      emit Trade(user_, pair_, amount, side, getUnburnedSupply(), block.timestamp);
    }
    return true;
  }

  function shouldSwapBack() internal view returns (bool) {
    return !inSwap && swapEnabled && balanceOf(address(this)) > 0 && !isPair(_msgSender());
  }

  function swapBack() internal swapping {
    uint256 taxAmount = balanceOf(address(this));
    _approve(address(this), address(uniswapV2Router), taxAmount);

    uint256 __totalFee = totalFee();
    uint256 amountToBurn = (taxAmount * burnFee) / (__totalFee);
    uint256 amountToLP = (taxAmount * liquidityFee) / (__totalFee);
    uint256 amountToGov = (taxAmount * govFee) / (__totalFee);
    uint256 amountToDev = (taxAmount * devFee) / (__totalFee);
    taxAmount -= amountToBurn;
    taxAmount -= amountToLP;
    taxAmount -= amountToGov;
    taxAmount -= amountToDev;

    _burn(address(this), amountToBurn);
    transfer(protocolTreasury, amountToGov);
    transfer(devTreasury, amountToDev);

    address[] memory path = new address[](2);
    path[0] = address(this);
    path[1] = address(WETH);

    bool success = false;
    try
      uniswapV2Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
        taxAmount, // amount to jackPot
        0,
        path,
        address(this),
        block.timestamp
      )
    {
      success = true;
    } catch {}
    if (!success) {
      return;
    }

    uint256 wethAmountToJackpot = WETH.balanceOf(address(this));
    WETH.transfer(jackpotTreasury, wethAmountToJackpot);

    if (addLiquidityEnabled) {
      _doAddLp();
    }

    emit SwapBack(amountToBurn, amountToGov, amountToLP, wethAmountToJackpot, amountToDev, block.timestamp);
  }

  function _doAddLp() internal {
    address[] memory pathEth = new address[](2);
    pathEth[0] = address(this);
    pathEth[1] = address(WETH);

    uint256 tokenAmount = balanceOf(address(this));
    uint256 half = tokenAmount / 2;
    if (half < 1000) return;

    uint256 ethAmountBefore = address(this).balance;

    {
      /* success */
      bool success = false;
      try
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
          half,
          0,
          pathEth,
          address(this),
          block.timestamp
        )
      {
        success = true;
      } catch {}
      if (!success) {
        return;
      }
    }

    uint256 ethAmount = address(this).balance - ethAmountBefore;
    _addLiquidity(half, ethAmount);
  }

  function _addLiquidity(uint256 tokenAmount, uint256 ethAmount) internal {
    _approve(address(this), address(uniswapV2Router), tokenAmount);
    try
      uniswapV2Router.addLiquidityETH{ value: ethAmount }(
        address(this),
        tokenAmount,
        0,
        0,
        // protocol owned liquidity
        protocolTreasury,
        block.timestamp
      )
    {
      emit AddLiquidity(tokenAmount, ethAmount, block.timestamp);
    } catch {}
  }

  function doSwapBack() public onlyOwner {
    swapBack();
  }

  function takeFee(address sender, uint256 amount) internal returns (uint256) {
    uint256 feeAmount = (amount * totalFee()) / feeDenominator;
    _transfer(sender, address(this), feeAmount);
    return amount - feeAmount;
  }

  // FIXME: rewrite this
  function rescueToken(address tokenAddress) external onlyOwner {
    IERC20(tokenAddress).transfer(msg.sender, IERC20(tokenAddress).balanceOf(address(this)));
  }

  function clearStuckEthBalance() external onlyOwner {
    uint256 amountETH = address(this).balance;
    (bool success, ) = payable(_msgSender()).call{ value: amountETH }(new bytes(0));
    require(success, 'TonicToken: ETH_TRANSFER_FAILED');
  }

  function getUnburnedSupply() public view returns (uint256) {
    return totalSupply() - balanceOf(ZERO);
  }

  function setFeeReceivers(
    address _protocolTreasury,
    address _jackpotTreasury,
    address _devTreasury
  ) external onlyOwner {
    protocolTreasury = _protocolTreasury;
    jackpotTreasury = _jackpotTreasury;
    devTreasury = _devTreasury;
  }

  bool public isUnderlyingExchangeLocked = false;

  function setUnderlyingExchange(
    address _uniswapV2Router,
    address _uniswapV2Factory,
    address _weth
  ) external onlyOwner {
    require(!isUnderlyingExchangeLocked, 'Ecosystem is locked');
    uniswapV2Router = IUniswapV2Router02(_uniswapV2Router);
    uniswapV2Factory = IUniswapV2Factory(_uniswapV2Factory);
    WETH = IWETH(_weth);
  }

  function lockUnderlyingExchange() external onlyOwner {
    isUnderlyingExchangeLocked = true;
  }

  function setIsFeeExempt(address holder, bool exempt) external onlyOwner {
    isFeeExempt[holder] = exempt;
  }

  function setSwapBackSettings(bool _enabled) external onlyOwner {
    swapEnabled = _enabled;
  }

  function isPair(address account) public view returns (bool) {
    return _pairs.contains(account);
  }

  function addPair(address pair) public onlyOwner returns (bool) {
    require(pair != address(0), 'TonicToken: pair is the zero address');
    return _pairs.add(pair);
  }

  function delPair(address pair) public onlyOwner returns (bool) {
    require(pair != address(0), 'TonicToken: pair is the zero address');
    return _pairs.remove(pair);
  }

  function getMinterLength() public view returns (uint256) {
    return _pairs.length();
  }

  function getPair(uint256 index) public view returns (address) {
    require(index <= _pairs.length() - 1, 'TonicToken: index out of bounds');
    return _pairs.at(index);
  }

  receive() external payable {}
}

